import React from 'react'

const VideoDetail = ({ video }) => {
    if (!video) {
        return <div></div>
    }
    return <div>
                <div className='segmentBorder p10 r-10'>
                    <h4>{video.title}</h4>
                    <p>{video.description}</p>
                </div>
            </div>;
}

export default VideoDetail;
